import style from './about.module.css';
const About = ()=>{

    return(
        <section className={style.aboutsection}>
            <h1 className={style.abouttitle}>¿De que se trata todo esto?</h1>
            <h3 className={style.aboutcontent}>Es una web App, que funciona como catálogo de personajes de la serie animada Rick & Morty</h3>
            <h3 className={style.aboutcontent}>para ingresar, debes acceder mediante el formulario de LogIn que verifica formato y validez del email y contraseña ingresados</h3>
            <h3 className={style.aboutcontent}>Una vez dentro, puedes llamar a tu coleccion un personaje aleatorio, o llamar uno especifico por su número de ID</h3>
            <p className={style.aboutcontent}>tambien puedes gestionar tus personajes favoritos, filtrar por genero u ordenar por sus ID</p>
        </section>
    )
} 

export default About
